JASMA基準をクリアしつつも、性能を犠牲にしない。柿本改のレーシングスピリッツを踏襲するチューニングマフラー。ストリート重視で、最大限の性能を引き出し、中低速トルク・全域に渡るパワーアップ・クイックレスポンスを実現。エキゾーストチューンを楽しめる快適サウンド、92dB(インナーサイレンサー無し)を基準。チタン焼け色の特殊コーティングテール(特許出願中)フルTig溶接・フルステンレスで高品質。<br><br>●メインパイプ径(φ)60 ●タイコ径(φ)130 ●テール径(φ)90 ●テール(出口)S(左右) ●近接排気騒音値93dB ●リアピースのみ ●JASMA認定<br><br>※商品写真はイメージです。実際の商品とは形状が異なる場合がございますので、説明文内にてご確認ください。<br><br>対応車種：2002/5～2008/1 アテンザスポーツ LA-GG3S UA-GG3S DBA-GG3S 2.3 エンジン型式：L3-VE 駆動形式：2WD<br><br><br><br>排気系 | マフラー<tr><td colspan="2">
