レース用マフラーの性能をストリートレベルにフィードバック。ストリートという分野で必要とされる中低速でのトルクをできるだけ確保し、高回転でのパワー・レスポンスを実現させたパワーレデューサー＆内燃機構造の採用により、音量はインナーサイレンサー無しでJASMA基準に適合。ストリートで要求される高回転域でのパワーをより求めた為、音量はJASMA基準ギリギリレベル。JASMA基準（平成10年度）に適合しているので、安心してストリートで柿本改ならではのレーシーなサウンドを思う存分楽しんで頂ける。 <br><br>●メインパイプ径(φ)60 ●タイコ径(φ)127 ●テール径(φ)100 ●テール(出口)S(左右) ●近接排気騒音値93dB ●リアピースのみ ●JASMA認定<br><br>※商品写真はイメージです。実際の商品とは形状が異なる場合がございますので、説明文内にてご確認ください。<br><br>対応車種：2002/5～2008/1 アテンザスポーツ LA-GG3S UA-GG3S DBA-GG3S 2.3 エンジン型式：L3-VE 駆動形式：2WD<br><br><br><br>排気系 | マフラー<tr><td colspan="2">
